import React from 'react';
import {Link} from 'react-router-dom';
const ShopDisplay = (props)=>{
    const indianwearList =({indianwearData})=>{
        if(indianwearData){
            return indianwearData.map((item)=>{
                return(
                    <Link>
                    <h2 class="main-heading1">Best in Beauty</h2>
                    <div class="first-mainDiv">
                        <div class="first-mainDiv-cards">
                            <img src="https://images-static.nykaa.com/uploads/4ee9cff1-40b6-4959-9a51-e95adff8e3d2.jpg?tr=w-600,cm-pad_resize" alt="blushes-and-highlighters" loading="eager" srcset="https://images-static.nykaa.com/uploads/37049630-f953-4be4-8bae-0937379ee2f2.jpg?tr=w-1200,cm-pad_resize 2x">
                                </img>
                        </div>
                        <div class="first-mainDiv-cards">
                        <img src="https://images-static.nykaa.com/uploads/826d0c65-c609-498d-84e9-88340028aa9c.gif?tr=w-600,cm-pad_resize" alt="bestseller-combos" loading="eager" srcset="https://images-static.nykaa.com/uploads/826d0c65-c609-498d-84e9-88340028aa9c.gif?tr=w-1200,cm-pad_resize 2x">
                            </img>
                        </div>
                        <div class="first-mainDiv-cards">
                            <img src="https://images-static.nykaa.com/uploads/da8f000a-888c-4e52-9a28-d9129371bc7c.jpg?tr=w-600,cm-pad_resize" alt="Wanderlust" loading="eager" srcset="https://images-static.nykaa.com/uploads/da8f000a-888c-4e52-9a28-d9129371bc7c.jpg?tr=w-1200,cm-pad_resize 2x">
                                </img>
                        </div>
                    </div>
                    </Link>
                )
            })
        }
    }

    return(
        <>
        <div class="main-div">

            {indianwearList(props)}
                
                {/* <div id="coupon">
                    <button class="coupon_btn" onclick="closeCoupon()">&times;</button>
                </div> */}
              
                </div>
        </>
    )
}
export default ShopDisplay;
